    false,nt"url": null,nt"notes": "This annual narrative report for Cypress
    Creek National Wildlife Refuge summarizes refuge activities during calendar years
    2001-2002.  The report begins with an introduction to the refuge and a summary of
    the yearu2019s highlights and climatic conditions.  Information about monitoring
    and studies- including waterfowl and amphibian surveys, water quality monitoring
    - is provided next.  Habitat restoration and management projects are also covered;
    activities include wetland and upland restoration, water level management, moist
    soil management, prescribed burning, and invasive plant control.  Fish and wildlife
    management is discussed next with emphasis on bird banding and predator control.
    Coordination activities, such as agency partnerships and private land activities
    are outlined.  The resource protection section provides information about law enforcement,
    cultural resources management, and land acquisition.  Information about public education
    and recreation is given including visitor services and outreach programs.  Finally,
    refuge planning and administration are discussed.",nt"license_title": "License
